const MultiFAB = ()=>{
    return (
        <div>
            <a href="#" className="floating-button"><span className="floating-button__icon">+</span></a>
            <style jsx>
                {`
                    .floating-button{
                        color: black;
                    }

                    .floating-button:link, .floating-button:link:active{
                        position: fixed;
                        text-decoration: none;
                        bottom: 2rem;
                        right: 2rem;
                        height: 6rem;
                        width: 6rem;
                        border-radius: 50%;
                        background-color: white;
                        box-shadow: 0 .2rem 3rem rgba(0, 0, 0, 0.8);
                        cursor: pointer;
                        transition: all .2s ease;
                        display: flex;
                        justify-content: center;
                        /* align-items: center; */
                    }
                `}
            </style>
        </div>
    )
}

export default MultiFAB;
